  selector: 'app-homem',
  templateUrl: './homem.component.html',
  styleUrls: ['./homem.component.scss']
})
export class HomemComponent {

  isMobile: boolean;

  constructor(private deviceDetector: DeviceDetectorService) { }

  ngOnInit() {
    window.scrollTo(0, 0);
    this.isMobile = this.deviceDetector.isMobile();
  }
}
